<div class="header"><?php include("header.php"); ?></div><h1>TED2020 v1</h1>This dataset is described in <a href="https://arxiv.org/abs/2004.09813">Reimers, Nils and Gurevych, Iryna: Making Monolingual Sentence Embeddings Multilingual using Knowledge Distillation</a> and  contains a crawl of nearly 4000 <a hef="https://www.ted.com/">TED and TED-X</a> transcripts from July 2020. The transcripts have been <a href="https://www.ted.com/participate/translate">translated by a global community of volunteers</a> to more than 100 languages. The parallel corpus and the code fopr cerating it is available from <a href="https://github.com/UKPLab/sentence-transformers/blob/master/docs/datasets/TED2020.md">https://www.ted.com/participate/translate</a><p>108 languages, 4,796 bitexts<br>total number of files: 101,958<br>total number of tokens: 173.40M<br>total number of sentence fragments: 11.46M<br><p>Please, cite: <blockquote><pre>@inproceedings{reimers-2020-multilingual-sentence-bert,<br/>    title = "Making Monolingual Sentence Embeddings Multilingual using Knowledge Distillation",<br/>    author = "Reimers, Nils and Gurevych, Iryna",<br/>    booktitle = "Proceedings of the 2020 Conference on Empirical Methods in Natural Language Processing",<br/>    month = "11",<br/>    year = "2020",<br/>    publisher = "Association for Computational Linguistics",<br/>    url = "https://arxiv.org/abs/2004.09813",<br/>}</pre></blockquote> and, please, acknowledge OPUS as well for this service.<h3>Download</h3><p>Below you can download data files for all language pairs in different formats and with different kind of annotation (if available). You can click on the various links as explained below. In addition to the files shown on this webpage, OPUS also provides pre-compiled word alignments and phrase tables, bilingual dictionaries, frequency counts, and these files can be found through the <a href="/index.php">resources search form on the top-level website of OPUS</a>.</p><p><b>License:</b> Please respect the <a href="https://www.ted.com/about/our-organization/our-policies-terms/ted-talks-usage-policy">TED Talks Usage Policy</a><br/></p><h3>Release history:</h3><p><ul></ul></p><table><tr><td>Bottom-left triangle: download files<ul><li><i>ces</i> = sentence alignments in XCES format</li> <li><i>leftmost column language IDs</i> = tokenized corpus files in XML</li> <li>TMX and plain text files (Moses): see "Statistics" below</li> <li><i>lower row language IDs</i> = parsed corpus files (if they exist)</li></ul></td><td>Upper-right triangle: sample files <ul><li><i>view</i> = bilingual XML file samples</li> <li><i>upper row language IDs</i> = monolingual XML file samples</li> <li><i>rightmost column language IDs</i> = untokenized corpus files</li></ul></td></tr></table><p><div class="sample"><table border="0" cellpadding="0">
